* [[Tar-Aldarion|Aldarion]] returns from [[Middle-earth]] with nine ships loaded with fine timber from the forests of the coasts of Middle-earth, after having built two additional ships at the haven of [[Vinyalondë]].<ref name="Wife">{{UT|Wife}}, first pages and NOTES, ''Chronology''</ref>
* Aldarion departs again towards Middle-earth with a fleet of three ships for a fourteen-year long voyage. As [[Tar-Meneldur]] had ordered the shipyards of [[Rómenna]] to be closed and had forbidden the felling of trees for shipbuilding, Aldarion's ships needed refitment because they had been damaged by rough winds.<ref name="Wife"/>

